carbonmap_data.Poverty._text = "<p>Countries are resized to show the number of people in them who live on less than two US dollars a day. Poverty is considered to be another kind of climate change vulnerability because lack of access to health and other basic services increases the risks of climatic changes, and lack of access to capital makes it harder to implement adaptation measures.</p> ";
